SELECT ?state ?stateLabel WHERE {
  SERVICE wikibase:enrev {
    ?state wdt:P30 wd:Q142 .
    FILTER (?state != wd:Q142)
  }
  ?state wdt:P1 ?population .
  FILTER ((?population > "63279500") && (BOUND(?population)))
  BIND(STRAFTER(STR(?state), STR("http://www.wikidata.org/entity/") ) AS ?stateLabel)
} GROUP BY ?state ORDER BY DESC (?population)
